    <style>
      :root {
        --animationTime: 30s;
        --animationPlayState: ease-in-out;
        --animationIteration: infinite;
        --animationDirection: alternate;
      }

      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        max-height: 100vh;
        display: flex;
        align-items: center;
        justify-content: stretch;
      }

      #shape-1 {
        transition: 0.5s;
        transform-box: fill-box;
        transform-origin: center;
      }

      #shape-2 {

        transform-box: fill-box;
        transform-origin: center;
        animation: shapeTwo var(--animationTime) var(--animationPlayState)
          var(--animationIteration) var(--animationDirection);

      }

      #shape-4 {

        transform-box: fill-box;
        transform-origin: center;
        animation: shapeFour var(--animationTime) var(--animationPlayState)
          var(--animationIteration) var(--animationDirection);
      }

      #shape-5 {
        transition: 0.5s;
        transform-box: fill-box;
        transform-origin: center;
        animation: shapeFive var(--animationTime) var(--animationPlayState)
          var(--animationIteration) var(--animationDirection);
      }

      #shape-2:hover,
      #shape-3:hover,

    <script>
      function animateOnHover(
        e,
        id,
        randomValue = Math.floor(Math.random() * 300)
      ) {
        const el = document.querySelector(id);
        el.style.transform = `translate(${-e.offsetX * randomValue * 0.05}px, ${
          -e.offsetY * randomValue * 0.05
        }px)`;
      }

      document.getElementById("module").addEventListener("mousemove", (e) => {
        animateOnHover(e, "#logo-1", -5);
        animateOnHover(e, "#logo-3", 1);
        // animateOnHover(e, "#shape-4", -1);
        // animateOnHover(e, "#shape-5", 5);
        // animateOnHover(e, "#shape-6", -4);
      });
    </script>
